import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [banks, setBanks] = useState([]);
  useEffect(() => {
    axios.get("/api/banks").then((data) => setBanks(data));
  }, []);
  console.log(banks);
  return (
    <div className="app">
      <h1>Branches</h1>
    </div>
  );
}

export default App;
